import { Link } from "react-router-dom";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <div className="nav">
          <div className="inner-content"></div>
        </div>
      </div>
    </Router>
  );
}

export default App;
